import re

def find_overllaping_occurences(string, substring):
	return len(re.findall('(?='+substring+')', string))


with open("dataset_2_7.txt", "r") as f:
	geny = f.readlines()


print(find_overllaping_occurences(geny[0].strip(), geny[1].strip()))
